INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0, 0, 7001, -363.0, "キャル", 7, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0, 0, 7002, -363.0, "コッコロ", 7, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0, 0, 7003, -363.0, "ペコリーヌ", 7, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0, 0, 10001, -363.0, "ペコリーヌ", 10, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0, 0, 10002, -363.0, "キャル", 10, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0, 0, 10003, -363.0, "コッコロ", 10, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, 0, 2104010, 10004, -363.0, "シェフィ", 10, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0, 0, 12001, -416.5, "ペコリーヌ", 12, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0, 0, 13001, -363.0, "キャル", 13, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0, 0, 13002, -363.0, "コッコロ", 13, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, 0, 2104010, 13003, -363.0, "シェフィ", 13, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0, 0, 13004, -363.0, "ペコリーヌ", 13, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0, 0, 14001, -363.0, "コッコロ", 14, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, 0, 2104010, 14002, -363.0, "シェフィ", 14, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0, 0, 14003, -363.0, "ペコリーヌ", 14, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0, 0, 14004, -363.0, "キャル", 14, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0, 0, 15001, -470.0, "コッコロ", 15, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, 0, 2104010, 16001, -363.0, "シェフィ", 16, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 0, 0, 16002, -363.0, "ペコリーヌ", 16, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 0, 0, 16003, -363.0, "キャル", 16, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 0, 0, 16004, -363.0, "コッコロ", 16, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 0, 0, 17002, -363.0, "コッコロ", 17, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 0, 0, 17004, -363.0, "キャル", 25, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 0, 0, 17005, -363.0, "コッコロ", 25, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, 0, 2104010, 17006, -363.0, "シェフィ", 25, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 0, 0, 17007, -363.0, "ペコリーヌ", 25, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 0, 0, 18001, -363.0, "カリン", 18, 1, "2015/12/17 15:00:00", 190801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 0, 0, 18002, -363.0, "カリン", 18, 1, "2015/12/17 15:00:00", 190801, 0.0, 2);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, 0, 0, 19001, -470.0, "カリン", 19, 1, "2015/12/17 15:00:00", 190801, 0.0, 3);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 0, 0, 19002, -470.0, "カリン", 19, 1, "2015/12/17 15:00:00", 190801, 0.0, 4);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 0, 0, 20001, -470.0, "カリン", 20, 1, "2015/12/17 15:00:00", 190801, 0.0, 5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 0, 0, 20002, -470.0, "カリン", 20, 1, "2015/12/17 15:00:00", 190801, 0.0, 6);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 0, 0, 21001, -363.0, "キャル", 21, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 0, 0, 21002, -363.0, "コッコロ", 21, 1, "2015/12/17 15:00:00", 105901, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, 0, 2104010, 21003, -363.0, "シェフィ", 21, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 0, 0, 21004, -363.0, "ペコリーヌ", 21, 1, "2015/12/17 15:00:00", 105801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 0, 0, 22001, -430.0, "カリン", 22, 1, "2015/12/17 15:00:00", 190801, 0.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 0, 0, 22002, -430.0, "カリン", 22, 1, "2015/12/17 15:00:00", 190801, 0.0, 2);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 0, 0, 23001, -430.0, "カリン", 23, 1, "2015/12/17 15:00:00", 190801, 0.0, 3);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 0, 0, 23002, -430.0, "カリン", 23, 1, "2015/12/17 15:00:00", 190801, 0.0, 4);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4.08, "2030/12/17 14:59:59", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 10011, 0, 24001, -385.0, "エリコ（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109001, 8.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5.0, "2030/12/17 14:59:59", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, 10011, 0, 24002, -385.0, "エリコ（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109001, 8.0, 2);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10.11, "2030/12/17 14:59:59", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, 10011, 0, 24003, -385.0, "エリコ（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109001, 8.0, 3);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4.0, "2030/12/17 14:59:59", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, 10011, 0, 24004, -385.0, "エリコ（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109001, 8.0, 4);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (6.0, "2030/12/17 14:59:59", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, 10011, 0, 24005, -385.0, "エリコ（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109001, 8.0, 5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 10011, 0, 24006, 0.0, "エリコ（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109002, 0.0, 6);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 10011, 0, 24007, 0.0, "エリコ（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109002, 0.0, 7);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 10011, 0, 24008, 0.0, "エリコ（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109002, 0.0, 8);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 10011, 0, 24009, 0.0, "エリコ（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109002, 0.0, 9);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 10011, 0, 24010, 0.0, "エリコ（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109002, 0.0, 10);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2.12, "2030/12/17 14:59:59", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 10011, 0, 24011, -385.0, "シズル（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109101, 8.0, 1);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (4.19, "2030/12/17 14:59:59", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, 10011, 0, 24012, -385.0, "シズル（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109101, 8.0, 2);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (2.3, "2030/12/17 14:59:59", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, 10011, 0, 24013, -385.0, "シズル（バレンタイン）", 24, 4, "2019/01/31 12:00:00", 109101, 8.0, 3);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 10011, 0, 24014, 0.0, "シズル（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109102, 0.0, 4);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5.23, "2030/12/17 14:59:59", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 10011, 0, 24015, -385.0, "シズル（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109101, 8.0, 5);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 10011, 0, 24016, 0.0, "シズル（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109102, 0.0, 6);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (5.01, "2030/12/17 14:59:59", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, 10011, 0, 24017, -385.0, "シズル（バレンタイン）", 24, 2, "2019/01/31 12:00:00", 109101, 8.0, 7);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 10011, 0, 24018, 0.0, "シズル（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109102, 0.0, 8);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 10011, 0, 24019, 0.0, "シズル（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109102, 0.0, 9);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 10011, 0, 24020, 0.0, "シズル（バレンタイン）", 24, 1, "2019/01/31 12:00:00", 109102, 0.0, 10);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2, 0, 2104010, 26001, -363.0, "シェフィ", 26, 1, "2015/12/17 15:00:00", 106401, 0.0, 1);
