INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0.0, "2030/12/17 14:59:59", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 0, 0, 43003, -363.0, "キャル", 43, 1, "2015/12/17 15:00:00", 106001, 0.0, 1);
